import React, { useEffect, useState } from 'react'
import './ExploredMenu.css'
import { assets } from '../../images/Games/assets';
const ExploredMenu = () => {
  const [listPopular, addListPopular] = useState([]);
  useEffect(()=>{
    fetch('popular.json')
    .then(response => response.json())
    .then(data => addListPopular(data))
    .catch(error => console.log("Error", error))
    console.log(...listPopular);
  },[])
  return (
    <div className='exploredMenu'>
        <h3><span className='title'>Most Popular </span><span className='title2'>Right Now</span></h3>
        <div className='list-menu-popular'>
            {
              listPopular.map((game)=>{
                return(
                  <div className='item'>
                    <div  className='item-img'>
                      <img src={game.img} alt=""/>
                    </div>
                       <ul className='line line-1' >
                          <li>
                            {game.name}
                          </li>
                          <li>
                           {game.rating}
                          </li>
                          </ul>
                        <ul className='line line-2'>
                          <li>{game.designer}</li>
                          <li>{game.downloaded}</li>
                        </ul>
                      </div>
                )
              })
            }
        </div>
    </div>
  )
}

export default ExploredMenu
